import React, {Component } from 'react';
import down from '../../assets/down.png';
import up from '../../assets/up.png';
import './Setter.css'

export default class Setter extends Component {
    constructor(props) {
        super(props);
        this.state = {
            breakCount: 0,
            sessionCount: 0
        }
    }
        bIncrement() {
            this.setState({
              breakCount: this.state.count + 1
            });
          };

        bDecrement() {
            this.setState({
                breakCount: this.state.count - 1
            });
          };


        sIncrement() {
            this.setState({
                sessionCount: this.state.count + 1
            });
        };

        sDecrement() {
            this.setState({
                sessionCount: this.state.count - 1
            });
        };


    render() {
        return (
            <div className="setter_div">
                <div className="break_div set_length">
                    <p>Break Length</p>
                    <div>
                        <div className="set">
                            <button id="down" onClick={(e) => this.bDecrement(e)}></button> 
                        </div>
                        <div className="set number">{this.state.bCount}</div>
                        <div className="set">
                            <button id="up"></button> 
                        </div>
                    </div>
                </div>

                <div className="session_div set_length">
                    <p>Session Length</p>
                    <div>
                        <div className="set">
                            <button id="down"></button> 
                        </div>
                        <div className="set number">25</div>
                        <div className="set">
                            <button id="up"></button> 
                        </div>
                    </div>
                </div>

            </div>
        )
    }
}
